## This one returns an index or -1, and this one is to be used with longestSub3
def checkDup3(string):
    count = 0
    for x in range(len(string)):
        count = 0
        for y in range(len(string)):
            if string[x] == string[y]:
                count += 1
            if count > 1:
                #print("The char is " + string[x] + " " + string[x+1])
                return x + 1
    return -1

