def longestSub(s):
    length = len(s)
    res = 0
    temp = 0
    for x in range(length):
        for y in range(x+1, length + 1):
            if checkDup(s[x:y]) == True:
                temp = 0
                break
            else:
                #print(s[x:y])
                temp = len(s[x:y])
                if temp > res:
                    res = temp
    if temp > res:
        return(temp)
    else:
        return(res)

#Second Version (more optimized)
def longestSub2(s):
    length = len(s)
    count = 1
    for x in range(length+1, -1, -1):
        for y in range(count):
            if checkDup(s[y:x+y]) == False:
                return (len(s[y:x+y]))
        count += 1

