#This one uses a dictionary and is the fastest one yet
def longestSubDict(s):
    largest = 0
    temp = 0
    d = defaultdict(lambda: -1, {})
    for index,x in enumerate(s):
        if d[x] == -1:
            d[x] = index
            temp += 1
        else:
            if temp > largest:
                largest = temp
            for y in list(d):
                if y == x:
                    d.pop(y)
                    break           
                temp -= 1
                d.pop(y)          
            d.update({x:index})             
    if temp > largest:
        return temp  
    return largest

## This one might be just a litte slower than the last one
def longestSubDict2(s):
    largest = 0
    d = defaultdict(lambda: -1, {})
    for index,x in enumerate(s):
        if (d[x] == -1):
            d[x] = index
        else:
            if len(d) > largest:
                largest = len(d)
            for y in list(d):
                if y == x:
                    d.pop(y)
                    break
                d.pop(y)
            d.update({x:index})
    if len(d)> largest:
        return len(d)
    return largest

